import React, { useMemo } from 'react';

const COLORS = {
  G93: '#34c759',
  G95: '#007bff',
  G97: '#a259c1',
  Diesel: '#fd7e14',
  Kero: '#6c757d'
};

const toNum = (v) => (v === '-' || v == null ? null : Number(v));
const fmtLabel = (dateStr) => {
  const onlyDate = (dateStr || '').split(' ')[0] || '';
  const parts = onlyDate.split('-'); // DD-MM-YYYY
  if (parts.length === 3) {
    const [, m, d] = parts; // evita 'y' sin uso
    return `${d}-${m}`;
  }
  return onlyDate;
};

export default function TrendChart({ dataRows = [], maxPoints = 7, height = 170, compact = true }) {
  const { labels, series, minY, maxY } = useMemo(() => {
    const sorted = [...dataRows]
      .sort((a, b) => {
        const da = new Date((a.fecha || '').split(' ')[0] || a.fecha);
        const db = new Date((b.fecha || '').split(' ')[0] || b.fecha);
        return da - db;
      })
      .slice(-maxPoints);

    const labels = sorted.map(r => fmtLabel(r.fecha));

    const make = (key) => sorted.map(r => toNum(r[key]));
    const series = [
      { label: 'G93', color: COLORS.G93, data: make('g93') },
      { label: 'G95', color: COLORS.G95, data: make('g95') },
      { label: 'G97', color: COLORS.G97, data: make('g97') },
      { label: 'Diesel', color: COLORS.Diesel, data: make('diesel') },
      { label: 'Kero', color: COLORS.Kero, data: make('kero') }
    ].filter(s => s.data.some(v => v != null));

    const vals = series.flatMap(s => s.data.filter(v => v != null));
    const minY = vals.length ? Math.min(...vals) : 0;
    const maxY = vals.length ? Math.max(...vals) : 1;

    return { labels, series, minY, maxY };
  }, [dataRows, maxPoints]);

  const width = 320;
  const margin = { top: 8, right: 8, bottom: 22, left: 42 };
  const innerW = width - margin.left - margin.right;
  const innerH = height - margin.top - margin.bottom;

  const xPos = (i) => {
    if (labels.length <= 1) return margin.left + innerW / 2;
    return margin.left + (i * innerW) / (labels.length - 1);
  };
  const yPos = (v) => {
    if (v == null) return null;
    const span = Math.max(1, (maxY - minY));
    const y = (v - minY) / span;
    return margin.top + innerH - y * innerH;
  };

  const gridY = 3;
  const yTicks = Array.from({ length: gridY + 1 }, (_, k) => minY + (k * (maxY - minY)) / Math.max(1, gridY));

  return (
    <div style={{ minWidth: 320, height }}>
      <svg width={width} height={height}>
        {/* Grid Y y etiquetas */}
        {yTicks.map((t, idx) => {
          const y = yPos(t);
          return (
            <g key={idx}>
              <line x1={margin.left} x2={margin.left + innerW} y1={y} y2={y} stroke="rgba(0,0,0,0.08)" />
              <text x={margin.left - 6} y={y} textAnchor="end" dominantBaseline="middle" fontSize="10">
                {Math.round(t).toLocaleString('es-CL')}
              </text>
            </g>
          );
        })}

        {/* Ticks X */}
        {labels.map((lab, i) => (
          <text key={i} x={xPos(i)} y={height - 6} textAnchor="middle" fontSize="10">{lab}</text>
        ))}

        {/* Series */}
        {series.map((s, si) => {
          const points = s.data.map((v, i) => ({ x: xPos(i), y: yPos(v), v }));
          const path = points.reduce((acc, p, i) => {
            if (p.y == null) return acc;
            if (i === 0 || points[i - 1].y == null) return acc + `M ${p.x} ${p.y}`;
            return acc + ` L ${p.x} ${p.y}`;
          }, '');
          return (
            <g key={si}>
              <path d={path} fill="none" stroke={s.color} strokeWidth="2" />
              {points.map((p, pi) => p.y != null ? (
                <circle key={pi} cx={p.x} cy={p.y} r="2" fill={s.color} />
              ) : null)}
            </g>
          );
        })}

        {/* Leyenda compacta arriba */}
        {series.map((s, i) => (
          <g key={s.label} transform={`translate(${margin.left + i * 60}, ${margin.top})`}>
            <rect width="8" height="8" fill={s.color} rx="2" ry="2" />
            <text x="12" y="8" fontSize="10">{s.label}</text>
          </g>
        ))}
      </svg>
    </div>
  );
}
